import React, {Component} from 'react';
import Header from './components/layout/Header';
import MandalArtTemplate from "./components/MandalArt/MandalArtTemplate";

class App extends Component {
    render() {
        return (
            <div>
                <Header/>
                <MandalArtTemplate/>
            </div>
        );
    };
}

export default App;
